import Register from './components/Register';

class App extends Component {
  render() {
    return (
      <React.Fragment>
        <CssBaseline />
        <Register />
        {/* <SignIn/> */}
        {/* rest of app  */}

      </React.Fragment>
    );
  }
}

export default App;
